QString stdCal_ins(R"(
<p><span style="font-size: 60px; font-family: Georgia, serif; background-color: rgb(147, 101, 184);">Standardrechner</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">Es ist der Kern dieser App und enth&auml;lt einige tolle Funktionen, die im Folgenden vorgestellt werden:</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;F&uuml;r <em><strong>binompdf(n,p,k)</strong></em> brauchen Sie nichts zu ver&auml;ndern; Sie geben die Parameter ein und das Ergebnis wird &nbsp;in mehreren Formatierungen ausgegeben.</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt; F&uuml;r <em><strong>binomcdf(n,p,k<sub>1</sub>,k<sub>2</sub>)</strong>&nbsp;</em>m&uuml;ssten Sie auf die Checkbox <em>&quot;kumulierte Wahrscheinlichkeitsrechnung&quot;</em> klicken und die Parameter eingeben. Der Taschenrechner erkennt und dr&uuml;ckt die Ereignisse <span style="color: rgb(44, 130, 201);">&quot;mindestens&quot;</span> und <span style="color: rgb(44, 130, 201);">&quot;h&ouml;chstens&quot;</span> entsprechend aus.</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Falls Ihnen nur die Parameter <strong>&mu;</strong> und <strong>&sigma;</strong> gegeben sind, k&ouml;nnen Sie auch alle Rechnungen mit diesen machen und bekommen ungef&auml;hre Werte f&uuml;r <strong>n</strong> und<strong>&nbsp;p</strong> dazu. Sie m&uuml;ssten daf&uuml;r blo&szlig; die Checkbox <em>&quot;Mit Erwartungswert und Standardabweichung rechnen&quot;</em> ausw&auml;hlen.</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;"><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Einige erw&auml;hnte Einstellungen des Standardrechners sind unter <em>&quot;Optionen anzeigen&quot;</em>&nbsp;</span><span style="font-size: 26px; font-family: Georgia, serif; color: rgb(251, 160, 38);">versteckt</span><span style="font-size: 26px; font-family: Georgia, serif;">, damit die Oberfl&auml;che f&uuml;r schnelle Rechungen&nbsp;</span><span style="font-size: 26px; font-family: Georgia, serif; color: rgb(97, 189, 109);">&uuml;bersichtlich&nbsp;</span><span style="font-size: 26px; font-family: Georgia, serif;">bleibt!<br></span></span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Der Knopf <em>&quot;Tabelle zeigen&quot;</em> erzeugt eine Tabelle f&uuml;r die entsprechenden Parameter <strong>n&nbsp;</strong>und<strong>&nbsp;p</strong> (oder <span style="font-size: 26px; font-family: Georgia, serif;"><strong>&mu;</strong> und <strong>&sigma;</strong></span>) mit drei Spalten f&uuml;r die Ereignisse &nbsp;<span style="color: rgb(251, 160, 38);">&quot;gleich&quot;</span>, <span style="font-size: 26px; font-family: Georgia, serif; color: rgb(251, 160, 38);">&quot;h&ouml;chstens&quot;</span> und <span style="font-size: 26px; font-family: Georgia, serif; color: rgb(251, 160, 38);">&quot;mindestens&quot;</span><span style="font-size: 26px; font-family: Georgia, serif;">. Sie k&ouml;nnen eine der Spalten deaktivieren, dadurch &auml;ndert sich eventuell der maximale Wert f&uuml;r <strong>n</strong>.&nbsp;</span></span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">Sie k&ouml;nnen auch <u>im Vorfeld</u> die Tabelle <strong>speichern</strong> lassen, und zwar als <em>.csv&nbsp;</em>Datei, die z.B. mit <em>Microsoft Excel</em> kompatibel ist. Klicken Sie daf&uuml;r auf die entsprechende Box. Um auf die Datei zuzugreifen, k&ouml;nnen Sie auf der gleichen H&ouml;he ganz rechts auf <em>&quot;Zielordner &ouml;ffnen&quot;</em> klicken. Der Ordner wird erst nach Speicherung einer Datei f&uuml;r jede einzelne Sitzung neu erstellt.</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Mit dem Knopf <em>&quot;Histogramm zeigen&quot;</em> k&ouml;nnen Sie den Parameter entsprechend ein Histogramm erzeugen lassen. Bei gro&szlig;en Zahlen ist es empfohlen, das Fenster zu maximieren f&uuml;r bessere Sicht. Die x-Achse ist so entwickelt, dass sie eine m&ouml;glichst gro&szlig;e Anzahl an ganzzahligen Werten zeigt, was nat&uuml;rlich einzig von <strong>n</strong> abh&auml;ngt.&nbsp;</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&Auml;hnlich wie bei den Tabellen k&ouml;nnen Sie sich ein <u>Screenshot</u> des Diagramms <strong>speichern&nbsp;</strong>lassen, allerdings m&uuml;ssen Sie die Box <u>vor</u> der Erstellung markiert haben. Die <em>.png</em> Datei (Foto) finden Sie auch im Zielordner.</span></p>
<p><span style="font-family: Georgia, serif; font-size: 26px;">&gt;&gt;Sie k&ouml;nnen sich mithilfe des Dropmenu <em>&quot;Konfidenzintervall aussuchen&quot;</em> verschiedene Konfidenzintervalle ausw&auml;hlen und deren Wahrscheinlichkeiten ausrechnen lassen.</span></p>
<p><span style="font-family: Georgia, serif; font-size: 26px;">&gt;&gt;Wenn Sie die Box <em>&quot;Markierungen anzeigen&quot;</em> aktivieren, werden f&uuml;r <strong>k</strong> eingegebene Werte oder <strong>ganze Intervalle</strong> im <u>Histogramm</u> <span style="color: rgb(226, 80, 65);">rot</span> markiert und deren Wahrscheinlichkeit im <u>Histogramm</u> angegeben. Damit k&ouml;nnen Sie ausdrucksvolle <u>Histogramme</u> erstellen.</span></p>
<p><br></p>
<p><span style="font-size: 30px; font-family: Georgia, serif; background-color: rgb(226, 80, 65);">Tips und Tricks:</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Sie werden gebeten, bei gro&szlig;en Werten f&uuml;r n etwas Geduld zu haben, wenn ein Ergebnis nicht sofort erscheint, sonst bringen Sie die App zum <span style="color: rgb(209, 72, 65);">Absturz</span>. Die durchschnittliche maximale Wartezeit auf eine Operation betr&auml;gt ca. <span style="color: rgb(84, 172, 210);">15 Sekunden</span>. Dies kann von einem Computer zum anderen nat&uuml;rlich variieren.&nbsp;</span></p>
<p><span style="font-size: 26px;"><span style="font-family: Georgia, serif;">&gt;&gt;Sie k&ouml;nnen mithilfe der&nbsp;</span><span style="color: rgb(84, 172, 210); font-family: Georgia, serif;">Leerzeichentaste</span><span style="font-family: Georgia, serif;">&nbsp;zwischen den Eingabefeldern zirkulieren. Beachten Sie aber, dass ein Leerzeichen zwischen zwei Zahlen f&uuml;r die Rechnung nicht akzeptabel ist.</span></span></p>
<p><span style="font-size: 26px;"><span style="font-family: Georgia, serif;">&gt;&gt;Sie k&ouml;nnen Eingaben f&uuml;r <strong>p&nbsp;</strong>, <span style="font-size: 26px; font-family: Georgia, serif;"><span style="font-size: 26px; font-family: Georgia, serif;"><strong>&mu;</strong> und <strong>&sigma;&nbsp;</strong>auch in <u>Bruchform</u> t&auml;tigen. Daf&uuml;r verwenden Sie als Bruchstrich den Schr&auml;gstrich <strong>&quot;/&quot;</strong>. Bei anschlie&szlig;ender Nutzung der&nbsp;</span><span style="font-size: 26px; font-family: Georgia, serif; color: rgb(84, 172, 210);">Leerzeichentaste</span><span style="font-size: 26px; font-family: Georgia, serif;">&nbsp;f&uuml;r Zirkulation wird die Eingabe in eine <u>Dezimalzahl</u> &uuml;berf&uuml;hrt.</span></span></span></span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Sie k&ouml;nnen in der Tabellenansicht in den Feldern reinschreiben, bzw. auch Inhalte kopieren. Dies ist komplett unabh&auml;ngig von der evtl. erzeugten <em>.csv</em> Datei.</span></p>
<p><br></p>
)");

QString wf_ins(R"(
<p><span style="font-size: 60px; font-family: Georgia, serif; background-color: rgb(147, 101, 184);">Wichtige Funktionen</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">Dieses Tool enth&auml;lt ein paar wichtige Rechenoperationen im Kontext der Binomialrechnung:</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Die <strong>Fakult&auml;t n!</strong> kann durch die Angabe von <em>n</em> berechnet werden.</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt; Die <strong>Potenzierung</strong> einer Zahl <strong>n</strong> mit<strong>&nbsp;k</strong> kann auch berechnet werden, auch wenn <em>n&nbsp;</em>oder <em>k</em> <span style="color: rgb(209, 72, 65);">negativ</span> sind. Daf&uuml;r achten Sie darauf, die Daten <u>imme</u><u>r</u><span style="font-family: Georgia, serif; font-size: 26px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; float: none; display: inline !important;">&nbsp;</span>von links nach rechts einzugeben.&nbsp;</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Die <strong>Permutation nPr</strong> sowie der <strong>Binomialkoeffizient nCr</strong> k&ouml;nnen durch Eingabe von <em>n</em> und <em>r</em> <em>(auch als k &uuml;blich)</em> berechnet werden. </span></p>
<p><br></p>
<p><span style="font-size: 30px; font-family: Georgia, serif; background-color: rgb(226, 80, 65);">Tips und Tricks:</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Da die Ergebnisse all dieser Operationen das Potenzial haben, durch gro&szlig;e eingegebene Zahlen zu <span style="color: rgb(235, 107, 86);">explodieren</span>, das hei&szlig;t: <span style="color: rgb(209, 72, 65);">sehr rasant</span> anzuwachsen, wurden Eingabegrenzen eingesetzt. Nichtdestotrotz wurden keine ausf&uuml;hrlichen Tests zur Stabilit&auml;t dieser Operationen gemacht. Bei regul&auml;rer Nutzung sollte dies gar nicht bemerkbar sein, aber man kann durchaus das Programm durch unvorteilhafte Zahlenkombinationen zum <span style="color: rgb(184, 49, 47);">Absturz</span> bringen. Deshalb sei das Tool bei sehr gro&szlig;en Eingaben <em>(Gr&ouml;&szlig;enordnung ab 10^5)</em> mit Vorsicht zu genie&szlig;en.</span></p>
<p><span style="font-size: 26px;"><span style="font-family: Georgia, serif;">&gt;&gt;Sie k&ouml;nnen mithilfe der&nbsp;</span><span style="color: rgb(84, 172, 210); font-family: Georgia, serif;">Leerzeichentaste</span><span style="font-family: Georgia, serif;">&nbsp;zwischen den Eingabefeldern der jeweiligen Operation zirkulieren. Beachten Sie aber, dass ein Leerzeichen zwischen zwei Zahlen f&uuml;r die Rechnung nicht akzeptabel ist.</span></span></p>
<p><br></p>
<p><br></p>
)");

QString prk_ins(R"(
<p><span style="color: rgb(255, 255, 255); font-family: Georgia, serif; font-size: 60px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(147, 101, 184); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; float: none; display: inline !important;">Parameter Retrieval Kit</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">Dieses Tool stellt eine <span style="color: rgb(97, 189, 109);">einzigartige</span> Hilfe bei der Bestimmung fehlender Parameter in einer Binomialrechnung dar. Sie erfordert aber vom Nutzer ein <em>gewisses Bewusstsein</em> f&uuml;r die Binomialverteilung, denn es gibt <u><span style="color: rgb(235, 107, 86);">nicht</span></u> immer f&uuml;r jede Kombination von gegebenen Parameter eine L&ouml;sung f&uuml;r das fehlende St&uuml;ck.</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">Man kann mithilfe des <span style="background-color: rgb(147, 101, 184);">Standardrechner</span>s in einer bestimmten Situation mehr Verst&auml;ndnis f&uuml;r das Verhalten des <span style="background-color: rgb(147, 101, 184);">PRK</span>s bekommen und das Ergebnis eventuell verifizieren, in dem man auf den Knopf <em>&quot;Daten in den Standardrechner kopieren&quot;</em> dr&uuml;ckt. <strong>Zus&auml;tzlich</strong> werden die Parameter <em><strong>&mu;</strong></em> und <em><strong>&sigma;</strong></em> angegeben, um bei der Orientierung zu helfen.</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Um das <span style="background-color: rgb(147, 101, 184);">PRK</span> zu nutzen, m&uuml;ssen Sie erst entscheiden, &nbsp;ob die Rechnung f&uuml;r ein <u>einzelnes Ergebnis</u> oder f&uuml;r ein <u>Intervall</u> gemacht werden soll. Dementsprechend &auml;ndern Sie die Auswahl bei der Checkbox <em>&quot;kumulierte Wahrscheinlichkeitsrechnung&quot;</em>.</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt; Dann k&ouml;nnen Sie aus der Liste rechts unten das <span style="color: rgb(44, 130, 201);">Parameter</span> aussuchen, welches Ihnen fehlt. Je nach Parameter &auml;ndern sich die Eingabem&ouml;glichkeiten und die Darstellung der Ergebnisse.</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">Sie brauchen also <u><span style="color: rgb(226, 80, 65);">nur</span></u> eine <span style="color: rgb(26, 188, 156);">richtige mathematische Formulierung</span> Ihres Problem zu treffen und dann liefert Ihnen das <span style="background-color: rgb(147, 101, 184);">PRK</span> das dazu passende Ergebnis f&uuml;r die fehlende Variable.</span></p>
<p><br></p>
<p><span style="font-size: 30px; font-family: Georgia, serif; background-color: rgb(226, 80, 65);">Tips und Tricks:</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Nutzen Sie das <span style="background-color: rgb(147, 101, 184);">PRK</span> <u>mit Vorsicht</u>, da das Verst&auml;ndnis und die Vorstellung einer Binomialrechnung nicht immer <em>trivial</em> ist.&nbsp;</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Es wird bei der Bestimmung von <strong>n</strong> oder <strong>p</strong> eine Angabe mit&nbsp;</span><span style="font-family: Georgia, serif;"><em style="font-family: Georgia, serif; font-size: 26px;"><strong>(&ge; ; &le;)&nbsp;</strong></em>&nbsp;</span><span style="font-size: 26px; font-family: Georgia, serif;">gemacht, die nicht ganz korrekt ist, wenn die Box &quot;H&ouml;here Grenze anzeigen&quot; deaktiviert ist, da dann die andere Grenze fehlt.<br></span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Achten Sie vor allem darauf, welche Werte Sie f&uuml;r das erwartete Ergebnis <strong>P</strong> eingeben, denn bei nicht-kumulierter Wahrscheinlichkeitsrechnung kann die Wahrscheinlichkeit f&uuml;r ein einzelnes Ereignis <u>nicht sehr viel betragen</u>.<br></span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Bei <u>kumulierter Rechnung</u> k&ouml;nnen Sie bei der <u>Suche nach <strong>n</strong></u> auch <strong>n</strong> als obere Grenze setzen <em>(f&uuml;r mindestens k1 Aussagen)</em>. Daf&uuml;r geben Sie f&uuml;r die <u>obere Grenze</u> den Buchstaben <strong>&quot;n&quot;</strong> ein und beachten Sie den erscheinenden <span style="color: rgb(235, 107, 86);">Warnhinweis</span>.</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;Sie k&ouml;nnen den <em>Vergleichsoperator <strong>(&ge; ; &le;)</strong></em> in der Ungleichung Ihren Bed&uuml;rfnissen anpassen. Es &auml;ndern sich mit ihm viele <span style="color: rgb(226, 80, 65);">Logikelemente</span> und <span style="color: rgb(226, 80, 65);">Intervalle</span> und entsprechend <span style="color: rgb(209, 72, 65);">Ergebnisse</span>, deshalb achten Sie darauf, welchen Vergleichsoperator Sie f&uuml;r Ihre L&ouml;sung ausgew&auml;hlt haben.&nbsp;</span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt;In manchen F&auml;llen <em>(mit&nbsp;</em></span><span style="font-family: Georgia, serif; font-size: 26px;"><em><strong>&le;</strong></em></span><span style="font-family: Georgia, serif;">&nbsp;</span><span style="font-size: 26px;"><span style="font-family: Georgia, serif;"><em>)</em> w&uuml;rde es von den Zahlen her Sinn ergeben, dass zum Beispiel die gefundene <em>obere Grenze</em> einer Binomialrechnung gr&ouml;&szlig;er ist als <em>n</em>, was aber von der Definition her&nbsp;</span><span style="color: rgb(184, 49, 47); font-family: Georgia, serif;">falsch</span><span style="font-family: Georgia, serif;">&nbsp;ist. Dies ber&uuml;cksichtigt das&nbsp;</span><span style="background-color: rgb(147, 101, 184); font-family: Georgia, serif;">PRK</span><span style="font-family: Georgia, serif;">&nbsp;aber gibt keine gesonderte Warnung dazu, deswegen <u>seien Sie vorsichtig an Intervallsgrenzen&nbsp;</u>und &uuml;berpr&uuml;fen Sie ggf. mit dem Standardrechner.</span></span></p>
<p><span style="font-size: 26px; font-family: Georgia, serif;">&gt;&gt; Das Tool ist eher <span style="color: rgb(26, 188, 156);">nicht absturzgef&auml;hrdet</span>, es existiert aber eine <span style="color: rgb(226, 80, 65);">Grenze</span> der m&ouml;glichen Ergebnisse &nbsp;f&uuml;r n und automatisch f&uuml;r k, n&auml;mlich wird n maximal <u><strong>10^4</strong> f&uuml;r nicht-kumulierte</u> und <u><strong>5000</strong> f&uuml;r kumulierte Wahrscheinlichkeitsrechnung</u> betragen.</span></p>
<p><span style="font-size: 26px;"><span style="font-family: Georgia, serif;">&gt;&gt;Sie k&ouml;nnen mithilfe der&nbsp;</span><span style="color: rgb(84, 172, 210); font-family: Georgia, serif;">Leerzeichentaste</span><span style="font-family: Georgia, serif;">&nbsp;zwischen den Eingabefeldern zirkulieren. Beachten Sie aber, dass ein Leerzeichen zwischen zwei Zahlen f&uuml;r die Rechnung nicht akzeptabel ist.</span></span></p>
<p><span style="font-size: 26px;"><span style="font-family: Georgia, serif;"><span style="font-size: 26px;">&gt;&gt;Sie k&ouml;nnen Eingaben f&uuml;r <strong>p&nbsp;</strong>und die Zielwahrscheinlichkeit<strong>&nbsp;P</strong><span style="font-size: 26px;"><span style="font-size: 26px;"><strong>&nbsp;</strong>auch in <u>Bruchform</u> t&auml;tigen. Daf&uuml;r verwenden Sie als Bruchstrich den Schr&auml;gstrich <strong>&quot;/&quot;</strong>. Bei anschlie&szlig;ender Nutzung der&nbsp;</span><span style="color: rgb(84, 172, 210);font-size: 26px;">Leerzeichentaste</span><span style="font-size: 26px;">&nbsp;f&uuml;r Zirkulation wird die Eingabe in eine <u>Dezimalzahl</u> &uuml;berf&uuml;hrt.</span></span></span></span></span></p>
<p><br></p>
)");

